DROP TABLE mytable;
CREATE TABLE mytable(
  OGZ_NR INTEGER(4) NOT NULL PRIMARY KEY 
, RTE_NR VARCHAR(3)
, Date DATE 
, RTE_Miles INTEGER(3)
, VEH_NR INTEGER(6)
, Total_Vol INTEGER(5)
, Total_Stop INTEGER(3)
, Car_Group VARCHAR(5)
, Make VARCHAR(5)
, Model VARCHAR(4)
, Fuel VARCHAR(2)
, Engine_Type VARCHAR(24)
, MilesRun VARCHAR(5)
, Fuel_Used VARCHAR(5)
, MPG VARCHAR(6)
);
